import React from 'react'
import App from './App.css'
const Navbar = () => {

  return(
   
    <nav className="navbar navbar-expand-lg navbar-light bg-light"> 
    <div className="container">
    <a className="navbar navbar-expand-lg navbar-light bg-light" href="/"><h3>Blog BTS</h3></a>
    <button  variant="flat" className="">Iniciar sesion </button>
     </div>
    </nav>
   

    )
  }

  export default Navbar;
